B.a_9=new A.bh('If phosphorus is zero, you can estimate it by looking at a similar item.\n\nIMPORTANT: you MUST adjust according to the weight!\n\nIf the item is 340g and your similar item is 100g, you must multiply by 3.4.\n\nYou can also use a search engine eg: "phosphate in a serving of mac and cheese" which will likely give you a range of values. The top end of that range is likely the safest.\n\nAIs can be also be used by giving them the title and the grams of the item. It may take a little refinement to get a good answer, but a good clue is to see it list each item in the ingredient list, and then give a total. Again, it\'s safest to use the highest value.\n\nIt is also possible to use the UPC number in place of the name.\n\nThe more complicated option is to look up all the ingredients, weigh each one, then use the USDA Food DB to get the phosphorus for each and total it.\n\nThe value entered will only be saved locally!',null,B.BP,null,null,null,null,null,null,null,null)
