B.a_B=new A.bh('The USDA Food DB doesn\'t always allow "Brand and Name" searches.\nIf the descriptions returned start with: "Brand: " (the : is imporntant)\nfollowed by the product name, a search that includes both may fail\n\nExample: "goya olive oil", or "olive oil goya" will return 6 results,\nbut will miss "GOYA: OLIVE OIL", however, if you search "oilive oil"\nand filter on "goya" it will return the four specifically branded entries.\n\nThis pattern seems to hold true for other similar searches and especially store\nbrands. It is a limitation of the search functionality from the USDA website.\n\nThis is what the "Filter results in Branded" field is for. It looks at the items returned\nby Search and filters them by the text entered in Filter.\n\nNote: While Filter will work for the other categories, it is a LOT faster in Search!\n',null,null,null,null,null,null,null,null,null,null)
