B.a_G=new A.bh("You are encouraged to assign the tags YOU think will aid in sorting and\nfinding saved items when you need them for a recipe, the Meal Log, or to\nedit!\n\nIn particular, the Breakfast, Lunch, Dinner, Side, and Snack tags are\nnot automatic. You assign them to make it easier to find what you want\nto enter into the Meal Log, or to edit.\n\nThe USDA Food DB has hundreds of food categories, many of which\noverlap. MealRx is only using a couple of dozen, making rule-based\nassignments difficult.\n",null,null,null,null,null,null,null,null,null,null)
